void main()
{
	// Abre a key do player
	ghp_UTILS::DataChunk privatekey, publickey;
	ghp_UTILS::StructuredFile db, dbtest;
	ghp_UTILS::DB ghpDB;

	if(!ghp_UTILS::LoadFileData(L"PRV.KEY", &privatekey) || !ghp_UTILS::LoadFileData(L"PUB.KEY", &publickey))
	{
		printf("Error while loading keys");
		privatekey.FreeAll();
		publickey.FreeAll();
		getchar();
		return;
	}

	if(!db.Set(DB_COUNT, sizeof(ghp_UTILS::Database), &ghpdb))
	{
		printf("Error while setting DB");
		privatekey.FreeAll();
		publickey.FreeAll();
		getchar();
		return;
	}

	if(!db.SaveToFile(DATABASE_NAME, privatekey.toString(), (UCHAR*)GHP_AES_KEY))
	{
		printf("Error while saving DB");
		privatekey.FreeAll();
		publickey.FreeAll();
		getchar();
		return;
	}

	// Verifica se salvou corretamente
	if(!dbtest.LoadFromFile(DATABASE_NAME, publickey.toString(), (UCHAR*)GHP_AES_KEY))
	{
		printf("Error while opening DB 1");
		privatekey.FreeAll();
		publickey.FreeAll();
		getchar();
		return;
	}

	if(!ghpDB.ImportFromStructuredFile(&dbtest) || ghpDB.GetEntryCount() == 0)
	{
		printf("Error while opening DB 2");
		privatekey.FreeAll();
		publickey.FreeAll();
		getchar();
		return;
	}

	privatekey.FreeAll();
	publickey.FreeAll();
}